import React from 'react';
import { BrowserRouter as Router, Link, Route, Switch } from 'react-router-dom';
import HomePage from './HomePage';
import AboutPage from './AboutPage'; // Import other pages as needed
import FeaturesPage from './FeaturesPage';
import ContactPage from './ContactPage';
import Navbar from './NavBar';
import '../styles/NavBar.css'; // Import the CSS file
import logo from '../assets/android-chrome-512x512.png';

export default function App() {
  const start = <img alt="logo" src={logo} height="40" className="mr-2"></img>;
  const end = (
    <div className="flex align-items-center gap-2">
      <InputText placeholder="Search" type="text" className="navbar__input" />
      <Avatar image="https://primefaces.org/cdn/primereact/images/avatar/amyelsner.png" shape="circle" className="navbar__avatar" />
    </div>
  );

  return (
    <Router>
      <div className="card">
        <Navbar start={start} end={end} />
        <Switch>
          <Route exact path="/" component={HomePage} />
          <Route path="/about" component={AboutPage} />
          <Route path="/features" component={FeaturesPage} />
          <Route path="/contact" component={ContactPage} />
        </Switch>
      </div>
    </Router>
  );
}
